import React, { useEffect, useState } from 'react'

const Function = () => {

    const [counter, setCounter] = useState(0)
    const [Users, fetchUsers] = useState([])

    const getData = () => {
        fetch('https://jsonplaceholder.typicode.com/users')
            .then((res) => res.json())
            .then((res) => {
                console.log("fetch API:", res)
                fetchUsers(res)
            })
    }

    useEffect(() => {
        setTimeout(() => {
            JSON.stringify(getData(), null, 2)
        }, 2000);
    }, [])

    const carObject = [
        { maruti: 'A1' },
        { Bike: 'B1' },
        { cycle: 'c1' }

    ]
    const exampleArray = () => {

    }
    console.log("carObject==>>",...carObject);
    

    const arrObj = [{a: 1, b: 2}, {c: 3, d: 4}, {e: 5, f: 6}];

    console.log(arrObj.reduce(function(result, current) {
      return Object.assign(result, current);
    }, {}));
    
    // If you prefer arrow functions, you can make it a one-liner ;-)
    console.log(arrObj.reduce(((r, c) => Object.assign(r, c)), {}));
    
    // Thanks Spen from the comments. You can use the spread operator with assign
    console.log(Object.assign({}, ...arrObj));

    return (
        <div>
            <h1>Count {counter}</h1>
            <ul>
                {Users.map((item, i) => {
                    return <li key={i}>{item.name}</li>
                })}
            </ul>
            <div>
                <button className="btn btn-primary btn-sm mx-2" onClick={() => { setCounter(counter + 1) }}> Count Increrase</button>
                <button className="btn btn-primary btn-sm mx-2" onClick={() => { }}> Count Decrerase</button>
            </div>

        </div>
    )
}

export default Function
